import React from 'react';

import ScanList from '../components/ScanList';

const DUMMY_SCANS = [
    {
        id: "scan1",
        titlu: "Scan rutina",
        descriere: "Scaneaza site-ul dupa ultimul commit in productie dd/mm/yyyy",
        addr: "192.168.0.1",
        tipScan: "WEB",
        creator: "utilizator1"

    },
    {
        id: "scan2",
        titlu: "Scan rutina",
        descriere: "Scaneaza site-ul dupa ultimul commit in productie dd/mm/yyyy",
        addr: "192.168.0.1",
        tipScan: "WEB",
        creator: "utilizator2"

    }

]

const UserScans = () => {
    return <ScanList items={DUMMY_SCANS}/>
};

export default UserScans;
